    [],nt"revision_timestamp": "2016-01-30T06:45:56.932422",nt"name": "us-amlr-program-marine-mammal-dataset",nt"isopen":
    false,nt"url": null,nt"notes": "As upper trophic level predators, pinnipeds
    are a conspicuous component of the marine ecosystem around the South Shetland Islands.
    They respond to spatio-temporal changes in physical and biological oceanography
    and Antarctic fur seals are the most abundant pinniped found at Cape Shirreff; shown
    here is a male (in back) and a female (silver color) with her pup.are directly dependent
    upon availability of krill for maintenance, growth, and reproduction during the
    austral summer.  The Antarctic fur seal, Arctocephalus gazella, is the most abundant
    pinniped at Cape Shirreff and our studies are focused to a large degree on this
    species.  Because of their current numbers and their pre-exploitation biomass in
    the Antarctic Peninsula and Scotia Sea regions, they are recognized to be an important
    krill-dependent upper trophic level predator. The general objectives for pinniped
    research at Cape Shirreff are to monitor population demography and trends, reproductive
    success, and status of pinnipeds throughout the summer months.",nt"license_title":
